response.activities:
Хирург-флеболог, ведущий специалист Санкт-Петербургского филиала Инновационного сосудистого центра. 
Член Балтийского общества флебологов (Baltic Society of Phlebology);
Европейского венозного форума (European Venous Forum);
Международного форума минихирургии варикозных вен (International Forum Minisurgery of Varicose Veins). 
Автор патента на технику интраоперационного foam-form гемостаза.
